import './App.css';
import Form from './Form';
import Form2 from './Form2';
import Thirdow from './Thirdrow';
import Fourthrow from './Fourthrow';
import Setting from './setting'
import Container from '@material-ui/core/Container';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (

    // <div id="yoyo">
    // <Form/>
    // </div>
    <Container id="idc" maxWidth="md">
    <Router>

    <Switch>
          <Route path="/Form">

                 <Form />
                 <Form2/>
                 <Thirdow/>
                 <Fourthrow/>
          </Route>

    </Switch>
    </Router>
    </Container>

  )
}

export default App;
